INSERT INTO `ds_announce` VALUES (151,'新手入门','<span style=\"color:#E53333;background-color:#FFE500;\">怎么成为会员？怎么赚钱？</span><br />\r\n&nbsp;&nbsp;&nbsp; 答：亲，你好。通过推荐人二维码下载自动刷单能量树软件，购买能量树后成为会员，便开启能量树自动点击刷单，帮您轻松赚钱！分享推广拥有更多收入！详见推广制度。<br />\r\n<span>在互联网时代，崛起了很多大平台，这些大平台靠什么赚钱呢?像百度、抖音、UC等，这些平台 70%的收益都来源于广告！经过我们公司开发，勘探。研发了一款符合国家政策的绿化产品！阿里能量树，为边防沙漠做贡献，种树产生收益！主要针对新疆区域的沙土做出改革！公司产品上市与2018年5月18日，经过实践与证明，我们的产品收益稳定，绿化效果明显！您赚钱的同时可以为社会作出一份贡献！ &nbsp; 本公司产品由上海市国际龙泰担保有限公司担保！手续齐全，资质齐全！可放心智投！</span><br />\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#E53333;background-color:#FFE500;\">自动赚钱阿里能量树能赚多少钱？</span> \r\n</p>\r\n<span>一个阿里生命树98元，为期30天，一天佣金5.76元，一共可以赚172.8元；</span><br />\r\n<p>\r\n	20个阿里生命树一个月可以赚3456元！\r\n</p>\r\n<p>\r\n	一个阿里科技树198元，为期30天，一天13.44元。一共赚403.2元\r\n</p>\r\n<p>\r\n	20个阿里科技树一月可以赚8064元！\r\n</p>\r\n<p>\r\n	一个圣诞树398元，一天佣金33.12元，一共可以赚993.6元！\r\n</p>\r\n<p>\r\n	20个圣诞树一月赚19872元！ 月入万元不是梦。\r\n</p>\r\n<br />\r\n<span>推广收益：直推好友购买一台阿里能量树可获得12佣金....</span><br />\r\n<br />\r\n<span>累计推荐够5名好友购买能量树 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;系统奖励一颗阿里生命树</span><br />\r\n<br />\r\n<span>累计推荐够12名好友购买能量树 &nbsp; &nbsp; &nbsp;&nbsp; 系统奖励一颗阿里科技树</span><br />\r\n<br />\r\n<span>累计推荐够24名 &nbsp; 系统奖励两颗阿里圣诞树！</span><br />\r\n<span style=\"color:#E53333;background-color:#FFE500;\">&nbsp;我应该怎么推广比较快？如何收益最大化？</span><br />\r\n<p>\r\n	&nbsp;&nbsp;&nbsp; 答：1、多发朋友圈；2、一对一发消息，微信、qq等通讯工具；3、建项目群；4、线下一对一沟通，可以展示自己的能量树介绍，更有说服力；5、组织线下沙龙，一对多推广。 以上几点分享内容为：项目内容、前景分析、收益展示、权威分享、推广海报等有关项目资料 。\r\n</p>\r\n<p>\r\n	源码来自九牛网&nbsp; <a href=\"https://www.9nw.cc\" target=\"_blank\">https://www.9nw.cc</a> \r\n</p>','admin',1559808342,1568782653,'/Public/Uploads/zixun/20190918/5d81b93d6be65.png','all',2),(154,'充值提现说明','<h1 style=\"text-align:center;\">\r\n	<span style=\"background-color:#FFE500;color:#E53333;\">充值实时到账，提现30分钟内到账！</span>\r\n</h1>\r\n<p>\r\n	<span style=\"background-color:#FFE500;color:#E53333;\">如果充值未到账请及时联系客服！提现目前仅支持微信提现，支付宝提现！</span>\r\n</p>','admin',1564127722,1564127722,'/Public/Uploads/zixun/20190726/5d3ab28a5